th icon file POSIX file \"$BHDIR/Util/SimRobot/Src/SimRobot/Icons/SimRobot.icns\" default answer \"$COMMAND\" buttons {\"Cancel \", \"Deploy\"} default button 2\n      if button returned of result = \"Deploy\" then\n        return (text returned of result) as string\n      else\n        return \"\"\n      end if\n    end tell\n    APPLESCRIPT\n  `\nfi\nif [ ! -z \"$COMMAND\" ]; then\n  NAME=`sed \"s% *\\([^ ]*\\).*%\\1%\" <<<\"$COMMAND\"`\n  IP=`$NAME_TO_IP <<<\"$NAME\"`\n  echo \"sc Remote $IP\" >../../Config/Scenes/Includes/connect.con\n  echo \"$COMMAND\" | sed \"s% *[^ ]* *%%\" >copyfiles-options.txt\n  ../Common/copyfiles $CONFIGURATION -nc `echo \"$COMMAND\" | sed -e \"s% -a%%\" -e \"s%<robot>%%\"`\nfi\n";
